import { Route, Routes} from 'react-router-dom'
import SideMenu from '../SideMenu/dashboard';
import EmployeeForm from '../../pages/EmployeeForm/EmployeeForm';
import AppFooter from '../AppFooter/footer';
import AppHeader from '../AppHeader/header';

function AppRoutes(){
    return(
        
        <Routes>
            <Route path='/' element={<AppHeader />}></Route>
            <Route path='/' element={<SideMenu />}></Route>
            <Route path='/' element={<EmployeeForm />}></Route>
            <Route path='/' element={<EmployeeList />}></Route>
            <Route path='/' element={<AppFooter />}></Route>


        </Routes>
       
        
        
       
    )

}
export default AppRoutes;
